    data: |
      pragma pg
      SELECT DISTINCT + + col2 / - 83 + 79 AS col1 FROM tab0 AS cor0 WHERE NOT + col0 IS NULL GROUP BY col1, col2 HAVING NOT NULL IS NOT NULL;
  - name: tab0

outputs:
  - name: q5251.out
    data: |
      79
